struct Solution {}
impl Solution {
    pub fn is_subsequence(s: String, t: String) -> bool {
        if s.is_empty() {
            return true;
        }

        let t = t.chars().collect::<Vec<char>>();
        let mut skip = 0;
        for sc in s.chars() {
            match t.iter().skip(skip).position(|&x| x == sc) {
                None => return false,
                Some(v) => {
                    skip += v + 1;
                }
            }
        }

        true
    }
}

fn main() {
    assert_eq!(
        Solution::is_subsequence("abc".to_string(), "ahbgdc".to_string()),
        true
    );
    assert_eq!(
        Solution::is_subsequence("".to_string(), "ahbgdc".to_string()),
        true
    );
    assert_eq!(
        Solution::is_subsequence("b".to_string(), "c".to_string()),
        false
    );
    assert_eq!(
        Solution::is_subsequence(
            "twn".to_string(),
            "xxxxxxxxxxxxxxxxxxxxxxxxxxxxxxtxxxxxxxxxxxxxxxxxxxxwxxxxxxxxxxxxxxxxxxxxxxxxxn"
                .to_string()
        ),
        true
    );
    assert_eq!(
        Solution::is_subsequence(
            "leeeeetcode".to_string(),
            ""
                .to_string()
        ),
        false
    );
}
